INSERT INTO `items` VALUES (605,'HTV-6 Cargo Craft Approaches Space Station','2016-12-13 20:12:00','2016-12-20 02:31:53','http://www.nasa.gov/image-feature/htv6-cargo-craft-approaches-space-station','Expedition 50 Commander Shane Kimbrough of NASA shared this photograph of the Japan Aerospace Exploration Agency’s Kounotori H-II Transfer Vehicle (HTV-6) as it approached the International Space Station. Kimbrough and Flight Engineer Thomas Pesquet successfully captured the spacecraft using the station\'s Canadarm2 robotic arm.','url=\"http://www.nasa.gov/sites/default/files/thumbnails/image/czj8bxlw8aapi4b.jpg\" length=\"336312\" type=\"image/jpeg\"','http://www.nasa.gov/image-feature/htv6-cargo-craft-approaches-space-station','NASA Image of the Day'),(606,'The Coolest Landscape on Mars (or Earth)','2016-12-12 17:54:00','2016-12-20 02:31:53','http://www.nasa.gov/image-feature/jpl/pia21216/the-coolest-landscape-on-mars-or-earth','Many Martian landscapes contain features that are familiar to ones we find on Earth, like river valleys, cliffs, glaciers and volcanos.','url=\"http://www.nasa.gov/sites/default/files/thumbnails/image/pia21216.jpg\" length=\"375807\" type=\"image/jpeg\"','http://www.nasa.gov/image-feature/jpl/pia21216/the-coolest-landscape-on-mars-or-earth','NASA Image of the Day'),(607,'Sunrise With Solar Array','2016-12-09 19:41:00','2016-12-20 02:31:53','http://www.nasa.gov/image-feature/sunrise-with-solar-array','Astronaut Thomas Pesquet of the European Space Agency captured this photograph from the International Space Station on Nov. 25, 2016, and shared it on social media, writing, \"Sunrises. We experience 16 sunrises every 24 hours on the International Space Station as it takes us 90 minutes to do a complete orbit of our planet flying at 28,800 km/h.\"','url=\"http://www.nasa.gov/sites/default/files/thumbnails/image/31430281685_5bf35c011d_o.jpg\" length=\"3132930\" type=\"image/jpeg\"','http://www.nasa.gov/image-feature/sunrise-with-solar-array','NASA Image of the Day'),(608,'Linear Dunes, Namib Sand Sea','2016-12-08 15:02:00','2016-12-20 02:31:53','http://www.nasa.gov/image-feature/linear-dunes-namib-sand-sea','An astronaut aboard the International Space Station (ISS) used a long lens to document what crews have termed one of the most spectacular features of the planet: the dunes of the Namib Sand Sea.','url=\"http://www.nasa.gov/sites/default/files/thumbnails/image/iss047e023405_lrg.jpg\" length=\"5944258\" type=\"image/jpeg\"','http://www.nasa.gov/image-feature/linear-dunes-namib-sand-sea','NASA Image of the Day'),(609,'Oceanic Nonlinear Internal Solitary Waves From the Lombok Strait','2016-12-07 15:37:00','2016-12-20 02:31:53','http://www.nasa.gov/image-feature/oceanic-nonlinear-internal-solitary-waves-from-the-lombok-strait','On November 1, 2016, NASA’s Aqua satellite passed over Indonesia, allowing the Moderate Resolution Imaging Spectroradiometer (MODIS) on board to capture a stunning true-color image of oceanic nonlinear internal solitary waves from the Lombok Strait.','url=\"http://www.nasa.gov/sites/default/files/thumbnails/image/image11052016_250m.jpg\" length=\"777770\" type=\"image/jpeg\"','http://www.nasa.gov/image-feature/oceanic-nonlinear-internal-solitary-waves-from-the-lombok-strait','NASA Image of the Day'),(610,'Sahara Desert From the Space Station\'s EarthKAM','2016-12-06 15:22:00','2016-12-20 02:31:53','http://www.nasa.gov/image-feature/sahara-desert-from-the-space-stations-earthkam','Middle school students programmed a camera aboard the International Space Station -- the Sally Ride EarthKAM -- to photograph this portion of the Sahara desert in western Libya on October 3, 2016. The Expedition 50 crew set up the EarthKAM gear in the Harmony module’s Earth-facing hatch window, to allow students to photograph targets on Earth.','url=\"http://www.nasa.gov/sites/default/files/thumbnails/image/ccfid_113386_2016277154705_image.jpg\" length=\"5320086\" type=\"image/jpeg\"','http://www.nasa.gov/image-feature/sahara-desert-from-the-space-stations-earthkam','NASA Image of the Day'),(611,'Chaos at Hyperion','2016-12-05 18:22:00','2016-12-20 02:31:53','http://www.nasa.gov/image-feature/jpl/pia20512/chaos-at-hyperion','The moon Hyperion tumbles as it orbits Saturn.','url=\"http://www.nasa.gov/sites/default/files/thumbnails/image/pia20512-1041x398.jpg\" length=\"14434\" type=\"image/jpeg\"','http://www.nasa.gov/image-feature/jpl/pia20512/chaos-at-hyperion','NASA Image of the Day'),(612,'Hidden Figures Premiere and Award Ceremony','2016-12-02 19:26:00','2016-12-20 02:31:53','http://www.nasa.gov/image-feature/hidden-figures-premiere-and-award-ceremony-0','Actress Octavia Spencer, left, who plays Dorothy Vaughan in the film \"Hidden Figures\" and NASA Administrator Charles Bolden, right, greet NASA research mathematician Katherine Johnson, at a reception to honor NASA\'s \"human computers\" on Thursday, Dec. 1, 2016, at the Virginia Air and Space Center in Hampton, VA.','url=\"http://www.nasa.gov/sites/default/files/thumbnails/image/30996939630_ec3dc9a77c_o.jpg\" length=\"3154791\" type=\"image/jpeg\"','http://www.nasa.gov/image-feature/hidden-figures-premiere-and-award-ceremony-0','NASA Image of the Day'),(613,'Rift in Antarctica\'s Larsen C Ice Shelf','2016-12-01 15:33:00','2016-12-20 02:31:53','http://www.nasa.gov/image-feature/rift-in-antarcticas-larsen-c-ice-shelf','On Nov. 10, 2016, scientists on NASA\'s IceBridge mission photographed an oblique view of a massive rift in the Antarctic Peninsula\'s Larsen C ice shelf. Icebridge, an airborne survey of polar ice, completed an eighth consecutive Antarctic deployment on Nov. 18.','url=\"http://www.nasa.gov/sites/default/files/thumbnails/image/cxaovzcwqaa0nll.jpg\" length=\"462802\" type=\"image/jpeg\"','http://www.nasa.gov/image-feature/rift-in-antarcticas-larsen-c-ice-shelf','NASA Image of the Day'),(614,'NASA\'s Webb Telescope Clean Room \'Transporter\'','2016-11-30 17:33:00','2016-12-20 02:31:53','http://www.nasa.gov/image-feature/nasas-webb-telescope-clean-room-transporter','What looks like a teleporter from science fiction being draped over NASA\'s James Webb Space Telescope, is actually a \"clean tent.\" The clean tent protects Webb from dust and dirt when engineers at NASA\'s Goddard Space Flight Center transport the telescope out of the relatively dust-free cleanroom and into the vibration and acoustics testing areas.','url=\"http://www.nasa.gov/sites/default/files/thumbnails/image/tent2_0.jpg\" length=\"2494640\" type=\"image/jpeg\"','http://www.nasa.gov/image-feature/nasas-webb-telescope-clean-room-transporter','NASA Image of the Day'),(615,'Fiery South Atlantic Sunset','2016-11-29 18:01:00','2016-12-20 02:31:53','http://www.nasa.gov/image-feature/fiery-south-atlantic-sunset','An astronaut aboard the International Space Station photographed a sunset that looks like a vast sheet of flame. With Earth’s surface already in darkness, the setting sun, the cloud masses, and the sideways viewing angle make a powerful image of the kind that astronauts use to commemorate their flights.','url=\"http://www.nasa.gov/sites/default/files/thumbnails/image/iss049e049442_lrg.jpg\" length=\"7159466\" type=\"image/jpeg\"','http://www.nasa.gov/image-feature/fiery-south-atlantic-sunset','NASA Image of the Day'),(616,'Tiny Mimas, Huge Rings','2016-11-28 18:22:00','2016-12-20 02:31:53','http://www.nasa.gov/image-feature/jpl/pia20509/tiny-mimas-huge-rings','Saturn\'s icy moon Mimas is dwarfed by the planet\'s enormous rings.','url=\"http://www.nasa.gov/sites/default/files/thumbnails/image/pia20509-1041.jpg\" length=\"434218\" type=\"image/jpeg\"','http://www.nasa.gov/image-feature/jpl/pia20509/tiny-mimas-huge-rings','NASA Image of the Day'),(617,'Celebrating Thanksgiving Aboard the International Space Station','2016-11-25 00:24:00','2016-12-20 02:31:53','http://www.nasa.gov/image-feature/celebrating-thanksgiving-aboard-the-international-space-station','The six Expedition 50 crew members celebrate Thanksgiving in space, Nov. 24, 2016, with rehydrated turkey, stuffing, potatoes and vegetables.','url=\"http://www.nasa.gov/sites/default/files/thumbnails/image/cydlkybweaewesk.jpg_orig.jpeg\" length=\"379218\" type=\"image/jpeg\"','http://www.nasa.gov/image-feature/celebrating-thanksgiving-aboard-the-international-space-station','NASA Image of the Day'),(618,'Prototype of Space Station\'s Advanced Plant Habitat','2016-11-23 15:19:00','2016-12-20 02:31:53','http://www.nasa.gov/image-feature/prototype-of-space-stations-advanced-plant-habitat','A high fidelity test version of NASA’s Advanced Plant Habitat (APH), the largest plant chamber built for the agency, arrived at Kennedy Space Center the third week of November, 2016. The APH unit, containing small flowering plant seeds, will be delivered to the International Space Station in 2017.','url=\"http://www.nasa.gov/sites/default/files/thumbnails/image/30795688500_ed64d9f74b_o.jpg\" length=\"5951783\" type=\"image/jpeg\"','http://www.nasa.gov/image-feature/prototype-of-space-stations-advanced-plant-habitat','NASA Image of the Day'),(619,'Hubble Spies Spiral Galaxy','2016-11-22 17:04:00','2016-12-20 02:31:53','http://www.nasa.gov/image-feature/goddard/2016/hubble-spies-spiral-galaxy','Spiral galaxy NGC 3274 is a relatively faint galaxy located over 20 million light-years away in the constellation of Leo (The Lion).','url=\"http://www.nasa.gov/sites/default/files/thumbnails/image/potw1647a.jpg\" length=\"4306438\" type=\"image/jpeg\"','http://www.nasa.gov/image-feature/goddard/2016/hubble-spies-spiral-galaxy','NASA Image of the Day'),(620,'Faint F Ring and Prometheus','2016-11-21 18:22:00','2016-12-20 02:31:53','http://www.nasa.gov/image-feature/jpl/pia20508/faint-f-ring-and-prometheus','Surface features are visible on Saturn\'s moon Prometheus in this view from NASA\'s Cassini spacecraft.','url=\"http://www.nasa.gov/sites/default/files/thumbnails/image/pia20508-1041.jpg\" length=\"128303\" type=\"image/jpeg\"','http://www.nasa.gov/image-feature/jpl/pia20508/faint-f-ring-and-prometheus','NASA Image of the Day'),(621,'GOES-R Weather Satellite Ready For Launch','2016-11-19 16:44:00','2016-12-20 02:31:53','http://www.nasa.gov/image-feature/goes-r-weather-satellite-ready-for-launch','The United Launch Alliance Atlas V rocket and its GOES-R payload at the launchpad as preparations continue for launch at 5:42 p.m. EST, Saturday, Nov. 19, from Space Launch Complex 41.','url=\"http://www.nasa.gov/sites/default/files/thumbnails/image/ksc-20161118-ph_jbs01_0112.jpg\" length=\"10362355\" type=\"image/jpeg\"','http://www.nasa.gov/image-feature/goes-r-weather-satellite-ready-for-launch','NASA Image of the Day'),(622,'Expedition 50 Crew Launches to the International Space Station','2016-11-18 18:20:00','2016-12-20 02:31:53','http://www.nasa.gov/image-feature/expedition-50-crew-launches-to-the-international-space-station','In this one second exposure photograph, the Soyuz MS-03 spacecraft is seen launching from the Baikonur Cosmodrome with Expedition 50 crewmembers NASA astronaut Peggy Whitson, Russian cosmonaut Oleg Novitskiy of Roscosmos, and ESA astronaut Thomas Pesquet from the Baikonur Cosmodrome in Kazakhstan, Friday, Nov. 18, 2016, Kazakh time (Nov 17 EST).','url=\"http://www.nasa.gov/sites/default/files/thumbnails/image/31068115625_9b0dd3bcba_o.jpg\" length=\"2344537\" type=\"image/jpeg\"','http://www.nasa.gov/image-feature/expedition-50-crew-launches-to-the-international-space-station','NASA Image of the Day'),(623,'Expedition 50 Crew Waves Farewell','2016-11-17 22:28:00','2016-12-20 02:31:53','http://www.nasa.gov/image-feature/expedition-50-crew-waves-farewell','Expedition 50 crewmembers ESA astronaut Thomas Pesquet, top, NASA astronaut Peggy Whitson, middle, and Russian cosmonaut Oleg Novitskiy of Roscosmos wave farewell before boarding their Soyuz MS-03 spacecraft for launch Thursday, Nov. 17, 2016, (Kazakh Time) in Baikonur, Kazakhstan.','url=\"http://www.nasa.gov/sites/default/files/thumbnails/image/nhq201611170001.jpg\" length=\"2450357\" type=\"image/jpeg\"','http://www.nasa.gov/image-feature/expedition-50-crew-waves-farewell','NASA Image of the Day'),(624,'Cloudscape Over the Philippine Sea','2016-11-16 18:45:00','2016-12-20 02:31:53','http://www.nasa.gov/image-feature/cloudscape-over-the-philippine-sea','Flying over the Philippine Sea, an astronaut looked toward the horizon from the International Space Station and shot this photograph of three-dimensional clouds, the thin blue envelope of the atmosphere, and the blackness of space. The late afternoon sunlight brightens a broad swath of the sea surface on the right side of the image.','url=\"http://www.nasa.gov/sites/default/files/thumbnails/image/iss048e010018_lrg_0.jpg\" length=\"5091990\" type=\"image/jpeg\"','http://www.nasa.gov/image-feature/cloudscape-over-the-philippine-sea','NASA Image of the Day'),(625,'November 15, 1966: Gemini XII Crew Returns to Earth','2016-11-15 18:08:00','2016-12-20 02:31:53','http://www.nasa.gov/image-feature/november-15-1966-gemini-xii-crew-returns-to-earth','Following the Gemini XII splashdown on Nov. 15, 1966, astronauts Buzz Aldrin, left, and Jim Lovell are welcomed aboard the recovery aircraft carrier, USS Wasp, concluding their four-day mission. Gemini XII was the final flight of the Gemini program, a bridge between the Mercury and Apollo programs.','url=\"http://www.nasa.gov/sites/default/files/thumbnails/image/12-gemini_12_recovery-23jpg.jpg\" length=\"775246\" type=\"image/jpeg\"','http://www.nasa.gov/image-feature/november-15-1966-gemini-xii-crew-returns-to-earth','NASA Image of the Day'),(626,'Supermoon and Expedition 50 Soyuz','2016-11-14 17:21:00','2016-12-20 02:31:53','http://www.nasa.gov/image-feature/supermoon-and-expedition-50-soyuz','The moon, or supermoon, is seen rising behind the Soyuz rocket at the Baikonur Cosmodrome launch pad in Kazakhstan, Monday, Nov. 14, 2016. NASA astronaut Peggy Whitson, Russian cosmonaut Oleg Novitskiy of Roscosmos, and ESA astronaut Thomas Pesquet will launch from the Baikonur Cosmodrome to the International Space Station at 3:20 p.m. EST Nov. 17.','url=\"http://www.nasa.gov/sites/default/files/thumbnails/image/30678128460_542587097d_o.jpg\" length=\"1893342\" type=\"image/jpeg\"','http://www.nasa.gov/image-feature/supermoon-and-expedition-50-soyuz','NASA Image of the Day'),(627,'Getting to Know the Getz Ice Shelf','2016-11-10 17:12:00','2016-12-20 02:31:53','http://www.nasa.gov/image-feature/getting-to-know-the-getz-ice-shelf','As scientists and crew with NASA’s Operation IceBridge mission prepared for a research flight on Nov. 5, 2016, the weather in Punta Arenas, Chile, was cold, wet, and windy. But when they reached their survey site in West Antarctica, skies were clear and winds were calm—a perfect day for scientists to collect data over the Getz Ice Shelf.','url=\"http://www.nasa.gov/sites/default/files/thumbnails/image/getz_photo_2016310_lrg.jpg\" length=\"1460161\" type=\"image/jpeg\"','http://www.nasa.gov/image-feature/getting-to-know-the-getz-ice-shelf','NASA Image of the Day'),(628,'Wind Carved Rock on Mars','2016-11-09 19:05:00','2016-12-20 02:31:53','http://www.nasa.gov/image-feature/wind-carved-rock-on-mars','The distinctively fluted surface and elongated hills in this image in Medusae Fossae are caused by wind erosion of a soft fine-grained rock. Called yardangs, these features are aligned with the prevailing wind direction. This wind direction would have dominated for a very long time to carve these large-scale features into the exposed rock.','url=\"http://www.nasa.gov/sites/default/files/thumbnails/image/esp_046504_1785.jpg\" length=\"5109112\" type=\"image/jpeg\"','http://www.nasa.gov/image-feature/wind-carved-rock-on-mars','NASA Image of the Day'),(629,'Election Day 2016','2016-11-08 19:28:00','2016-12-20 02:31:53','http://www.nasa.gov/image-feature/election-day-2016','Thanks to a bill passed by Texas legislators that put in place technical voting procedure for astronauts, they have the ability to vote from space through specially designed absentee ballots. To preserve the integrity of the secret vote, the ballot is encrypted and only accessible by the astronaut and the county clerk responsible for casting it.','url=\"http://www.nasa.gov/sites/default/files/thumbnails/image/iss045e105414.jpg\" length=\"2082405\" type=\"image/jpeg\"','http://www.nasa.gov/image-feature/election-day-2016','NASA Image of the Day'),(630,'Ring Details on Display','2016-11-07 18:22:00','2016-12-20 02:31:53','http://www.nasa.gov/image-feature/jpl/pia20506/ring-details-on-display','This view from NASA\'s Cassini spacecraft showcases some of the amazingly detailed structure of Saturn\'s rings.','url=\"http://www.nasa.gov/sites/default/files/thumbnails/image/pia20506-1041.jpg\" length=\"101611\" type=\"image/jpeg\"','http://www.nasa.gov/image-feature/jpl/pia20506/ring-details-on-display','NASA Image of the Day'),(631,'Hubble Takes Flight with the Toucan and the Cluster','2016-11-04 17:51:00','2016-12-20 02:31:53','http://www.nasa.gov/image-feature/goddard/2016/hubble-takes-flight-with-the-toucan-and-the-cluster','NGC 299 is an open star cluster located within the Small Magellanic Cloud just under 200,000 light-years away.','url=\"http://www.nasa.gov/sites/default/files/thumbnails/image/potw1642a.jpg\" length=\"409447\" type=\"image/jpeg\"','http://www.nasa.gov/image-feature/goddard/2016/hubble-takes-flight-with-the-toucan-and-the-cluster','NASA Image of the Day'),(632,'Orion Crew Module Underway Recovery Testing','2016-11-03 17:52:00','2016-12-20 02:31:53','http://www.nasa.gov/image-feature/orion-crew-module-underway-recovery-testing','U.S. Navy divers and other personnel in a rigid hull Zodiac boat have attached tether lines to a test version of the Orion crew module during Underway Recovery Test 5 in the Pacific Ocean off the coast of California. NASA and the U.S. Navy are conducting a series of tests to practice for recovery of Orion on its return from deep space missions.','url=\"http://www.nasa.gov/sites/default/files/thumbnails/image/30660444486_d4a4e649d8_o.jpg\" length=\"241137\" type=\"image/jpeg\"','http://www.nasa.gov/image-feature/orion-crew-module-underway-recovery-testing','NASA Image of the Day'),(633,'James Webb Space Telescope Mirrors Will Piece Together Cosmic Puzzles','2016-11-02 15:36:00','2016-12-20 02:31:53','http://www.nasa.gov/image-feature/james-webb-space-telescope-mirrors-will-piece-together-cosmic-puzzles','The primary mirror of NASA\'s James Webb Space Telescope that consists of 18 hexagonal mirrors looks like a giant puzzle piece standing in the massive clean room of NASA\'s Goddard Space Flight Center in Greenbelt, Maryland. The telescope will help piece together puzzles scientists have been trying to solve throughout the cosmos.','url=\"http://www.nasa.gov/sites/default/files/thumbnails/image/otispostcocrev2.jpg\" length=\"1162307\" type=\"image/jpeg\"','http://www.nasa.gov/image-feature/james-webb-space-telescope-mirrors-will-piece-together-cosmic-puzzles','NASA Image of the Day'),(634,'Prototype Capture System, Mock Asteroid Help Simulate Mission Sequence','2016-11-01 15:11:00','2016-12-20 02:31:53','http://www.nasa.gov/image-feature/prototype-capture-system-mock-asteroid-help-simulate-mission-sequence','A prototype of the Asteroid Redirect Mission (ARM) robotic capture module system is tested with a mock asteroid boulder in its clutches at NASA’s Goddard Space Flight Center in Greenbelt, Maryland. The robotic portion of ARM is targeted for launch in 2021.','url=\"http://www.nasa.gov/sites/default/files/thumbnails/image/arm-prototype.jpg\" length=\"2177921\" type=\"image/jpeg\"','http://www.nasa.gov/image-feature/prototype-capture-system-mock-asteroid-help-simulate-mission-sequence','NASA Image of the Day'),(635,'Rains of Terror on Exoplanet HD 189733b','2016-10-31 20:15:00','2016-12-20 02:31:53','http://www.nasa.gov/image-feature/rains-of-terror-on-exoplanet-hd-189733b','This Halloween, take a tour with NASA\'s Exoplanet Exploration site of some of the most terrifying destinations in our galaxy. The nightmare world of HD 189733 b is the killer you never see coming. To the human eye, this far-off planet looks bright blue. But any space traveler confusing it with the friendly skies of Earth would be badly mistaken.','url=\"http://www.nasa.gov/sites/default/files/thumbnails/image/heic1312a.jpg\" length=\"1765300\" type=\"image/jpeg\"','http://www.nasa.gov/image-feature/rains-of-terror-on-exoplanet-hd-189733b','NASA Image of the Day'),(636,'Expedition 49 Soyuz Spacecraft Landing','2016-10-30 08:02:00','2016-12-20 02:31:53','http://www.nasa.gov/image-feature/expedition-49-soyuz-spacecraft-landing','The Soyuz MS-01 spacecraft is seen as it lands with Expedition 49 crew members NASA astronaut Kate Rubins, Russian cosmonaut Anatoly Ivanishin of Roscosmos, and astronaut Takuya Onishi of the Japan Aerospace Exploration Agency (JAXA) near the town of Zhezkazgan, Kazakhstan on Sunday, Oct. 30, 2016 (Kazakh time).','url=\"http://www.nasa.gov/sites/default/files/thumbnails/image/nhq201610300010.jpg\" length=\"1002370\" type=\"image/jpeg\"','http://www.nasa.gov/image-feature/expedition-49-soyuz-spacecraft-landing','NASA Image of the Day'),(637,'NASA Astronaut Kate Rubins Prepares For the Journey Home','2016-10-28 17:42:00','2016-12-20 02:31:53','http://www.nasa.gov/image-feature/nasa-astronaut-kate-rubins-prepares-for-the-journey-home','NASA astronaut Kate Rubins is pictured inside of the Soyuz MS-01 spacecraft while conducting routine spacesuit checks. The Expedition 49 trio of Rubins, JAXA astronaut Takuya Onishi and cosmonaut Anatoly Ivanishin are scheduled to undock their Soyuz on Saturday, Oct. 29, and land at 11:59 p.m. EDT.','url=\"http://www.nasa.gov/sites/default/files/thumbnails/image/30428935312_c69b2ff100_o.jpg\" length=\"3498939\" type=\"image/jpeg\"','http://www.nasa.gov/image-feature/nasa-astronaut-kate-rubins-prepares-for-the-journey-home','NASA Image of the Day'),(638,'First Pass of Echo 1 Satellite Over the Goldstone Tracking Station','2016-10-27 19:25:00','2016-12-20 02:31:53','http://www.nasa.gov/image-feature/first-pass-of-echo-1-satellite-over-the-goldstone-tracking-station','This photograph shows the first pass of Echo 1, America’s first communications satellite, over the Goldstone Tracking Station managed by NASA’s Jet Propulsion Laboratory, in Pasadena, California, in the early morning of Aug. 12, 1960. The movement of the antenna, star trails, and Echo 1 (the long streak in the middle) are visible in this image.','url=\"http://www.nasa.gov/sites/default/files/thumbnails/image/pia21114_p1446b-1600x1200.jpg\" length=\"1014350\" type=\"image/jpeg\"','http://www.nasa.gov/image-feature/first-pass-of-echo-1-satellite-over-the-goldstone-tracking-station','NASA Image of the Day'),(639,'Paw Paw Bends','2016-10-26 20:28:00','2016-12-20 02:31:53','http://www.nasa.gov/image-feature/paw-paw-bends','The Operational Land Imager (OLI) on Landsat 8 captured this image of the Potomac River and canal on September 27, 2016. The image shows the stretch between Hancock and Cumberland, Maryland—about 97 kilometers (60 miles) if you were to hike or bike along the towpath between these two towns. West Virginia is south of the river.','url=\"http://www.nasa.gov/sites/default/files/thumbnails/image/pawpawbends_oli_2016271_lrg.jpg\" length=\"10546896\" type=\"image/jpeg\"','http://www.nasa.gov/image-feature/paw-paw-bends','NASA Image of the Day'),(640,'Cygnus Spacecraft Attached to Space Station\'s Unity Module','2016-10-25 17:13:00','2016-12-20 02:31:53','http://www.nasa.gov/image-feature/cygnus-spacecraft-attached-to-space-stations-unity-module','Orbital ATK\'s Cygnus cargo craft (left) is seen from the Cupola module windows aboard the International Space Station on Oct. 23, 2016. The main robotic work station for controlling the Canadarm2 robotic arm is located inside the Cupola and was used to capture Cygnus upon its arrival.','url=\"http://www.nasa.gov/sites/default/files/thumbnails/image/30509478486_5fff4559ab_o.jpg\" length=\"1950293\" type=\"image/jpeg\"','http://www.nasa.gov/image-feature/cygnus-spacecraft-attached-to-space-stations-unity-module','NASA Image of the Day'),(641,'Hubble Spins a Web Into a Giant Red Spider Nebula','2016-10-21 14:42:00','2016-12-20 02:31:53','http://www.nasa.gov/image-feature/goddard/2016/hubble-spins-a-web-into-a-giant-red-spider-nebula','Huge waves are sculpted in this two-lobed nebula called the Red Spider Nebula, located some 3,000 light-years away in the constellation of Sagittarius.','url=\"http://www.nasa.gov/sites/default/files/thumbnails/image/heic0109a.jpg\" length=\"1669930\" type=\"image/jpeg\"','http://www.nasa.gov/image-feature/goddard/2016/hubble-spins-a-web-into-a-giant-red-spider-nebula','NASA Image of the Day'),(642,'Jupiterrise','2016-10-20 17:40:00','2016-12-20 02:31:53','http://www.nasa.gov/image-feature/jupiterrise','This image of the sunlit part of Jupiter and its swirling atmosphere was created by a citizen scientist (Alex Mai) using data from Juno\'s JunoCam instrument. JunoCam\'s raw images are available at www.missionjuno.swri.edu/junocam for the public to peruse and process into image products.','url=\"http://www.nasa.gov/sites/default/files/thumbnails/image/pia21108_0.jpg\" length=\"47503\" type=\"image/jpeg\"','http://www.nasa.gov/image-feature/jupiterrise','NASA Image of the Day'),(643,'Expedition 49 Launch to the International Space Station','2016-10-19 18:04:00','2016-12-20 02:31:53','http://www.nasa.gov/image-feature/expedition-49-launch-to-the-international-space-station','The Soyuz MS-02 rocket is launched with Expedition 49 Soyuz commander Sergey Ryzhikov of Roscosmos, flight engineer Shane Kimbrough of NASA, and flight engineer Andrey Borisenko of Roscosmos, Wednesday, Oct. 19, 2016 at the Baikonur Cosmodrome. The crew will spend the next four months living and working aboard the International Space Station.','url=\"http://www.nasa.gov/sites/default/files/thumbnails/image/30337466261_fe90aa9aed_o.jpg\" length=\"326533\" type=\"image/jpeg\"','http://www.nasa.gov/image-feature/expedition-49-launch-to-the-international-space-station','NASA Image of the Day'),(644,'Liftoff of Antares Rocket From NASA Wallops Flight Facility, Virginia','2016-10-18 06:13:00','2016-12-20 02:31:53','http://www.nasa.gov/image-feature/liftoff-of-antares-rocket-from-nasa-wallops-flight-facility-virginia','The Orbital ATK Antares rocket, with the Cygnus spacecraft onboard, launches from Pad-0A, Monday, October 17, 2016 at NASA\'s Wallops Flight Facility in Virginia. Cygnus is delivering over 5,100 pounds of science and research, supplies and hardware to the space station.','url=\"http://www.nasa.gov/sites/default/files/thumbnails/image/nhq201610170106.jpg\" length=\"3699930\" type=\"image/jpeg\"','http://www.nasa.gov/image-feature/liftoff-of-antares-rocket-from-nasa-wallops-flight-facility-virginia','NASA Image of the Day'),(645,'Orbital ATK Cargo Mission Set For Launch to Space Station','2016-10-17 19:58:00','2016-12-20 02:31:53','http://www.nasa.gov/image-feature/orbital-atk-cargo-mission-set-for-launch-to-space-station','The Orbital ATK Antares rocket, with the Cygnus spacecraft onboard, is seen on launch Pad-0A as the moon sets, predawn, Saturday, Oct. 15, 2016 at NASA\'s Wallops Flight Facility in Virginia. Orbital ATK’s cargo resupply mission will deliver over 5,100 pounds of science and research, supplies and hardware to the space station.','url=\"http://www.nasa.gov/sites/default/files/thumbnails/image/29706136403_1fba77ce5f_o_1.jpg\" length=\"2551195\" type=\"image/jpeg\"','http://www.nasa.gov/image-feature/orbital-atk-cargo-mission-set-for-launch-to-space-station','NASA Image of the Day'),(646,'Antares Rocket Raising','2016-10-14 22:21:00','2016-12-20 02:31:53','http://www.nasa.gov/image-feature/antares-rocket-raising','The Orbital ATK Antares rocket, with the Cygnus spacecraft onboard, is raised into the vertical position on launch Pad-0A, Friday, Oct. 14, 2016, at NASA\'s Wallops Flight Facility. Scheduled to launch Oct. 16, Orbital ATK’s cargo resupply mission will deliver over 5,100 pounds of science and research, supplies and hardware to the space station.','url=\"http://www.nasa.gov/sites/default/files/thumbnails/image/29690070064_14745822ac_o.jpg\" length=\"3403174\" type=\"image/jpeg\"','http://www.nasa.gov/image-feature/antares-rocket-raising','NASA Image of the Day'),(647,'A Laser-Sharp View of Blended Wing Body Plane Design','2016-10-13 16:20:00','2016-12-20 02:31:53','http://www.nasa.gov/image-feature/langley/a-laser-sharp-view-of-blended-wing-body-plane-design','Engineers at NASA\'s Langley Research Center in Hampton, Virginia, used lasers inside the 14- by 22-Foot Subsonic Tunnel to map how air flows over a Boeing Blended Wing Body (BWB) model – a greener, quieter airplane design under development.','url=\"http://www.nasa.gov/sites/default/files/thumbnails/image/lrc_2016_h1_p_bwblasertest-100601.jpg\" length=\"4797038\" type=\"image/jpeg\"','http://www.nasa.gov/image-feature/langley/a-laser-sharp-view-of-blended-wing-body-plane-design','NASA Image of the Day'),(648,'Inspecting the Space Station\'s Expandable Habitat','2016-10-12 17:31:00','2016-12-20 02:31:53','http://www.nasa.gov/image-feature/inspecting-the-space-stations-expandable-habitat','NASA astronaut Kate Rubins inspected the Bigelow Aerospace Expandable Activity Module (BEAM) attached to the International Space Station. Expandable habitats are designed to take up less room on a spacecraft while providing greater volume for living and working in space once expanded.','url=\"http://www.nasa.gov/sites/default/files/thumbnails/image/29637425124_af9670e5de_o.jpg\" length=\"2105956\" type=\"image/jpeg\"','http://www.nasa.gov/image-feature/inspecting-the-space-stations-expandable-habitat','NASA Image of the Day'),(649,'In Daylight on the Night Side','2016-10-11 16:22:00','2016-12-20 02:31:53','http://www.nasa.gov/image-feature/jpl/pia20505/in-daylight-on-the-night-side','NASA\'s Cassini spacecraft looks down at the rings of Saturn from above the planet\'s nightside.','url=\"http://www.nasa.gov/sites/default/files/thumbnails/image/pia20505-1041.jpg\" length=\"412659\" type=\"image/jpeg\"','http://www.nasa.gov/image-feature/jpl/pia20505/in-daylight-on-the-night-side','NASA Image of the Day'),(650,'Star Trails Seen From Low Earth Orbit','2016-10-07 16:50:00','2016-12-20 02:31:53','http://www.nasa.gov/image-feature/star-trails-seen-from-low-earth-orbit','Astronauts on the International Space Station captured a series of incredible star trail images on Oct. 3, 2016, as they orbited at 17,500 miles per hour. The station orbits the Earth every 90 minutes, and astronauts aboard see an average of 16 sunrises and sunsets every 24 hours.','url=\"http://www.nasa.gov/sites/default/files/thumbnails/image/29529061813_6797c55422_o.jpg\" length=\"1755879\" type=\"image/jpeg\"','http://www.nasa.gov/image-feature/star-trails-seen-from-low-earth-orbit','NASA Image of the Day'),(651,'Space Station Flyover of Hurricane Matthew','2016-10-06 20:07:00','2016-12-20 02:31:53','http://www.nasa.gov/image-feature/space-station-flyover-of-hurricane-matthew','The International Space Station has tracked Hurricane Matthew all week, providing images and video from low Earth orbit as the storm hit the Caribbean Sea and made its way towards Florida. In this photograph taken by Expedition 49 Flight Engineer Kate Rubins on Oct. 4, 2016, at 21:05 GMT, the hurricane\'s clouds extend across the frame.','url=\"http://www.nasa.gov/sites/default/files/thumbnails/image/iss049e028833.jpg\" length=\"1545709\" type=\"image/jpeg\"','http://www.nasa.gov/image-feature/space-station-flyover-of-hurricane-matthew','NASA Image of the Day'),(652,'Hurricane Matthew Hits Haiti','2016-10-05 17:58:00','2016-12-20 02:31:53','http://www.nasa.gov/image-feature/hurricane-matthew-hits-haiti','On October 4, 2016, Hurricane Matthew made landfall on southwestern Haiti as a category-4 storm—the strongest storm to hit the Caribbean nation in more than 50 years. Just hours after landfall, the Moderate Resolution Imaging Spectroradiometer (MODIS) on NASA’s Terra satellite acquired this natural-color image.','url=\"http://www.nasa.gov/sites/default/files/thumbnails/image/matthew_tmo_2016278_lrg.jpg\" length=\"11826273\" type=\"image/jpeg\"','http://www.nasa.gov/image-feature/hurricane-matthew-hits-haiti','NASA Image of the Day'),(653,'Rover\'s Panorama Taken Amid \'Murray Buttes\' on Mars','2016-10-04 16:37:00','2016-12-20 02:31:53','http://www.nasa.gov/image-feature/jpl/pia20840/rovers-panorama-taken-amid-murray-buttes-on-mars','This 360-degree panorama was acquired by the Mast Camera (Mastcam) on NASA\'s Curiosity Mars rover .','url=\"http://www.nasa.gov/sites/default/files/thumbnails/image/pia20840.jpg\" length=\"5002268\" type=\"image/jpeg\"','http://www.nasa.gov/image-feature/jpl/pia20840/rovers-panorama-taken-amid-murray-buttes-on-mars','NASA Image of the Day'),(654,'A Trio of Plumes in the South Sandwich Islands','2016-10-03 17:40:00','2016-12-20 02:31:53','http://www.nasa.gov/image-feature/a-trio-of-plumes-in-the-south-sandwich-islands','On September 29, 2016, the Moderate Resolution Imaging Spectroradiometer (MODIS) on NASA’s Aqua satellite captured this false-color image (MODIS bands 7-2-1) showing volcanic activity in the South Sandwich Islands. Located in the South Atlantic Ocean, the uninhabited South Sandwich Islands include several active stratovolcanoes.','url=\"http://www.nasa.gov/sites/default/files/thumbnails/image/southsandwich_amo_2016273_lrg.jpg\" length=\"9255004\" type=\"image/jpeg\"','http://www.nasa.gov/image-feature/a-trio-of-plumes-in-the-south-sandwich-islands','NASA Image of the Day'),(655,'Space Station\'s Expandable Habitat','2016-09-30 17:16:00','2016-12-20 02:31:53','http://www.nasa.gov/image-feature/space-stations-expandable-habitat','The Bigelow Expandable Activity Module (BEAM) is seen attached to the Tranquility module of the International Space Station. BEAM is an is an experimental expandable habitat. Expandable habitats, occasionally described as inflatable habitats, greatly decrease the amount of transport volume for future space missions.','url=\"http://www.nasa.gov/sites/default/files/thumbnails/image/29894260842_1d70c6d562_o.jpg\" length=\"1317577\" type=\"image/jpeg\"','http://www.nasa.gov/image-feature/space-stations-expandable-habitat','NASA Image of the Day'),(656,'Testing the James Webb Space Telescope Pathfinder','2016-09-29 17:38:00','2016-12-20 02:31:53','http://www.nasa.gov/image-feature/testing-the-james-webb-space-telescope-pathfinder','In this photograph taken on Sept. 1, 2016, the James Webb Space Telescope Pathfinder structure has been configured for the Thermal Pathfinder Test at NASA Johnson Space Center\'s giant thermal vacuum chamber, called Chamber A. The Pathfinder is a test version of the structure that supports the telescope.','url=\"http://www.nasa.gov/sites/default/files/thumbnails/image/29677447760_35cb318fbb_o.jpg\" length=\"3401217\" type=\"image/jpeg\"','http://www.nasa.gov/image-feature/testing-the-james-webb-space-telescope-pathfinder','NASA Image of the Day'),(657,'\'Pandora\'s Cluster\' Seen by Spitzer','2016-09-28 20:55:00','2016-12-20 02:31:53','http://www.nasa.gov/image-feature/jpl/pia20920/pandoras-cluster-seen-by-spitzer','This image of galaxy cluster Abell 2744, also called Pandora\'s Cluster, was taken by the Spitzer Space Telescope.','url=\"http://www.nasa.gov/sites/default/files/thumbnails/image/pia20920.jpg\" length=\"728534\" type=\"image/jpeg\"','http://www.nasa.gov/image-feature/jpl/pia20920/pandoras-cluster-seen-by-spitzer','NASA Image of the Day'),(658,'Water Swirls, Gulf of St. Lawrence','2016-09-27 19:22:00','2016-12-20 02:31:53','http://www.nasa.gov/image-feature/water-swirls-gulf-of-st-lawrence','Orbiting above eastern North America, a crew member on the International Space Station photographed a dense pattern of eddies in the Gulf of St. Lawrence. Caught briefly in the Sun’s “glint point,” reflections off the water surface show an interlinked mass of swirls and eddies in the shallow water north of Prince Edward Island.','url=\"http://www.nasa.gov/sites/default/files/thumbnails/image/iss048e071829_lrg.jpg\" length=\"4652853\" type=\"image/jpeg\"','http://www.nasa.gov/image-feature/water-swirls-gulf-of-st-lawrence','NASA Image of the Day'),(659,'Tectonically Active Planet Mercury','2016-09-26 18:55:00','2016-12-20 02:31:53','http://www.nasa.gov/image-feature/tectonically-active-planet-mercury','New NASA-funded research suggests that Mercury is contracting even today, joining Earth as a tectonically active planet. Images obtained by NASA’s MESSENGER spacecraft reveal previously undetected small fault scarps— cliff-like landforms that resemble stair steps.','url=\"http://www.nasa.gov/sites/default/files/thumbnails/image/press_photo_4.jpg\" length=\"1516247\" type=\"image/jpeg\"','http://www.nasa.gov/image-feature/tectonically-active-planet-mercury','NASA Image of the Day'),(660,'Hubble Views a Colorful Demise of a Sun-like Star','2016-09-23 17:35:00','2016-12-20 02:31:53','http://www.nasa.gov/image-feature/goddard/2016/hubble-views-a-colorful-demise-of-a-sun-like-star','This star is ending its life by casting off its outer layers of gas, which formed a cocoon around the star\'s remaining core.','url=\"http://www.nasa.gov/sites/default/files/thumbnails/image/heic0703a.jpg\" length=\"295455\" type=\"image/jpeg\"','http://www.nasa.gov/image-feature/goddard/2016/hubble-views-a-colorful-demise-of-a-sun-like-star','NASA Image of the Day'),(661,'Cosmic ‘Winter’ Wonderland111','2016-12-19 17:49:00','2016-12-20 02:32:18','http://www.nasa.gov/mission_pages/chandra/cosmic-winter-wonderland.html','Although there are no seasons in space, this cosmic vista invokes thoughts of a frosty winter landscape. It is, in fact, a region called NGC 6357 where radiation from hot, young stars is energizing the cooler gas in the cloud that surrounds them.111','url=\"http://www.nasa.gov/sites/default/files/thumbnails/image/ngc6357.jpg\" length=\"9803323\" type=\"image/jpeg\"','http://www.nasa.gov/mission_pages/chandra/cosmic-winter-wonderland.html','NASA Image of the Day'),(669,'Hubble \"Crane-s\" in for a Closer Look at a Galaxy','2016-12-16 18:32:00','2016-12-20 16:16:42','http://www.nasa.gov/image-feature/goddard/2016/hubble-cranes-in-for-a-closer-look-at-a-galaxy','Spiral galaxy IC 5201 sits 40 million light-years from us in the Crane constellation. As with most spirals we see, it has a bar of stars slicing through its center.','url=\"http://www.nasa.gov/sites/default/files/thumbnails/image/potw1650a.jpg\" length=\"448427\" type=\"image/jpeg\"','http://www.nasa.gov/image-feature/goddard/2016/hubble-cranes-in-for-a-closer-look-at-a-galaxy','NASA Image of the Day'),(670,'View of NASA\'s CYGNSS Hurricane Mission Launch From Chase Plane','2016-12-15 19:09:00','2016-12-20 16:16:42','http://www.nasa.gov/image-feature/view-of-nasas-cygnss-hurricane-mission-launch-from-chase-plane','Hurricane forecasters will soon have a new tool to better understand and forecast storm intensity. A constellation of eight microsatellites, called NASA’s Cyclone Global Navigation Satellite System mission, or CYGNSS, got a boost into Earth orbit aboard an Orbital ATK Pegasus XL rocket, deployed from an L-1011 aircraft.','url=\"http://www.nasa.gov/sites/default/files/thumbnails/image/g0043192.jpg\" length=\"3152107\" type=\"image/jpeg\"','http://www.nasa.gov/image-feature/view-of-nasas-cygnss-hurricane-mission-launch-from-chase-plane','NASA Image of the Day'),(671,'Color Variations on Mount Sharp, Mars','2016-12-14 19:12:00','2016-12-20 16:16:42','http://www.nasa.gov/image-feature/color-variations-on-mount-sharp-mars','The foreground of this scene from the Mast Camera (Mastcam) on NASA\'s Curiosity Mars rover shows purple-hued rocks near the rover\'s late-2016 location on lower Mount Sharp. The scene\'s middle distance includes higher layers that are future destinations for the mission.','url=\"http://www.nasa.gov/sites/default/files/thumbnails/image/pia21256_sol1516mrseq07719-nolabels.jpg\" length=\"3111407\" type=\"image/jpeg\"','http://www.nasa.gov/image-feature/color-variations-on-mount-sharp-mars','NASA Image of the Day');
